import React, { useState } from 'react';
import AddNewTodo from './AddNewTodo';

import Todos from './Todos';

const dumyTodos=[
    {
        id:1,
        title:'title 1',
        desc:'descripton 1 for todo project'
    },
    {
        id:2,
        title:'title 2',
        desc:'descripton 2 for todo project'
    }
]

const Home = () => {

    const[todos,setTodos]=useState([]);

    const addTodo=(item)=>{
        setTodos([item]);
    }
  return (
    <div  className='container mt-2'>
        <div className='row'>
            <div className='col-5'>
            <AddNewTodo  onAddNewTodo={addTodo}/>
            </div>
            <div className='col-7'>
            <Todos todosList={todos}/>
            </div>
        </div>
       
    </div>
  )
}

export default Home
